	<div id="game-board">
		<div class="cell" id="cell00"></div>
		<div class="cell" id="cell01"></div>
		<div class="cell" id="cell02"></div>
		<div class="cell" id="cell10"></div>
		<div class="cell" id="cell11"></div>
		<div class="cell" id="cell12"></div>
		<div class="cell" id="cell20"></div>
		<div class="cell" id="cell21"></div>
		<div class="cell" id="cell22"></div>
	</div>
<script>
// Initialize game board
const board = document.querySelectorAll('.cell');
for (let i = 0; i < 9; i++) {
    board[i].textContent = ' ';
}

// Check for win conditions
function checkWin() {
    const rows = [
        [board[0], board[1], board[2]],
        [board[3], board[4], board[5]],
        [board[6], board[7], board[8]]
    ];

    for (let row of rows) {
        if (row.every(cell => cell.textContent === 'X')) {
            return true;
        }
    }
    return false;
}

// Check for draw
function isDraw() {
    return board.every(cell => cell.textContent !== ' ');
}

// Start game
document.getElementById('start').addEventListener('click', () => {
    board.forEach((cell, idx) => {
        cell.addEventListener('click', () => {
            const player = idx % 2 === 0 ? 'X' : 'O';
            cell.textContent = player;
            if (checkWin()) {
                alert(`Player ${player} wins!`);
                board.forEach(cell => cell.textContent = ' ');
                return;
            }
            if (isDraw()) {
                alert('It's a draw!');
                board.forEach(cell => cell.textContent = ' ');
                return;
            }
        });
    });
});
</script>
</body>
</html>
