<!DOCTYPE html>
<html>
<head>
    <title>Tic-Tac-Toe</title>
    <style>
        body { font-family: Arial, sans-serif; text-align: center; }
        table { border-collapse: collapse; margin: 20px auto; }</style>
</head>
<body>
<h1>Tic-Tac-Toe</h1>
<table id="game-board">
    <tr>
        <td id="cell-0"></td>
        <td id="cell-1"></td>
        <td id="cell-2"></td>
    </tr>
    <tr>
        <td id="cell-3"></td>
        <td id="cell-4"></td>
        <td id="cell-5"></td>
    </tr>
    <tr>
        <td id="cell-6"></td>
        <td id="cell-7"></td>
        <td id="cell-8"></td>
    </tr>
</table>
<script>
const cells = document.querySelectorAll('#game-board td');
const board = {
    cells: [0,1,2,3,4,5,6,7,8],
    currentPlayer: 'X',
    winner: null
};

function handleCellClick(index) {
    if (board.winner || cells[index].textContent) return;
    cells[index].textContent = board.currentPlayer;
    board.cells[index] = board.currentPlayer;
    checkForWin();
    checkForDraw();
    board.currentPlayer = board.currentPlayer === 'X' ? 'O' : 'X';
}

function checkForWin() {
    const winPatterns = [
        [0,1,2], [3,4,5], [6,7,8],
        [0,3,6], [1,4,7], [2,5,8],
        [0,4,8], [2,4,6]
    ];

    for (const pattern of winPatterns) {
        const [a, b, c] = pattern;
        if (board.cells[a] === board.cells[b] && board.cells[b] === board.cells[c] && board.cells[a] !== '') {
            board.winner = board.cells[a];
            alert(`Player ${board.currentPlayer} wins!`);
            resetGame();
            return;
        }
    }
}

function checkForDraw() {
    if (board.cells.every(cell => cell !== '')) {
        alert('It\'s a draw!');
        resetGame();
    }
}

function resetGame() {
    cells.forEach(cell => cell.textContent = '');
    board.winner = null;
    board.currentPlayer = 'X';
}

cells.forEach((cell, index) => {
    cell.addEventListener('click', () => handleCellClick(index));
});
</script>
</body>
</html>
