        const cellSize = 20;
        let snake = [{x: 10, y: 10}];
        let direction = {x: 1, y: 0};
        let food = {x: 5, y: 5};
        let gameInterval;

        function drawSnake() {
            ctx.fillStyle = 'lime';
            for (let segment of snake) {
                ctx.fillRect(segment.x * cellSize, segment.y * cellSize, cellSize, cellSize);
            }
        }

        function drawFood() {
            ctx.fillStyle = 'red';
            ctx.fillRect(food.x * cellSize, food.y * cellSize, cellSize, cellSize);
        }

        function gameLoop() {
            ctx.clearRect(0, 0, canvas.width, canvas.height);
            drawSnake();
            drawFood();

            // Move snake
            let head = {x: snake[0].x + direction.x, y: snake[0].y + direction.y};
            snake.unshift(head);

            // Check for collision with walls or self
            if (head.x < 0 || head.x >= canvas.width / cellSize || head.y < 0 || head.y >= canvas.height / cellSize) {
                alert('Game Over!');
                resetGame();
                return;
            }

            let selfCollision = false;
            for (let i = 1; i < snake.length; i++) {
                if (snake[i].x === head.x && snake[i].y === head.y) {
                    selfCollision = true;
                    break;
                }
            }

            if (selfCollision) {
                alert('Game Over!');
                resetGame();
                return;
            }

            // Check for food
            if (head.x === food.x && head.y === food.y) {
                food = {x: Math.floor(Math.random() * 20), y: Math.floor(Math.random() * 20)};
                // Increase snake length
                snake.push({x: snake[snake.length - 1].x, y: snake[snake.length - 1].y});
            } else {
                snake.pop();
            }

            // Update game state
            requestAnimationFrame(gameLoop);
        }

        function resetGame() {
            snake = [{x: 10, y: 10}];
            direction = {x: 1, y: 0};
            food = {x: Math.floor(Math.random() * 20), y: Math.floor(Math.random() * 20)};
            gameInterval = requestAnimationFrame(gameLoop);
        }

        // Handle keyboard input
        document.addEventListener('keydown', (e) => {
            if (e.key === 'ArrowUp' && direction.y !== 1) direction = {x: 0, y: -1};
            if (e.key === 'ArrowDown' && direction.y !== -1) direction = {x: 0, y: 1};
            if (e.key === 'ArrowLeft' && direction.x !== 1) direction = {x: -1, y: 0};
            if (e.key === 'ArrowRight' && direction.x !== -1) direction = {x: 1, y: 0};
        });

        // Start the game
        gameLoop();
    </script>
