        }
        .task-text {
            flex: 1;
            word-wrap: break-word;
        }
        .action-buttons {
            display: flex;
            gap: 5px;
        }
        .delete-btn, .complete-btn {
            background-color: #f0f0f0;
            padding: 8px 12px;
            border-radius: 4px;
        }
        .delete-btn {
            background-color: #ff6b81;
