<body>
    <div class="container">
        <h1>To-Do List</h1>
        <p>Use the buttons below to add, complete, and delete tasks.</p>

        <div class="input-group">
            <input type="text" id="taskInput" placeholder="Add a new task...">
            <button onclick="addTask()">Add</button>
        </div>

        <ul class="task-list" id="taskList">
            <!-- Tasks will be rendered here -->
        </ul>
    </div>

    <script>
        function addTask() {
            const input = document.getElementById('taskInput');
            const taskText = input.value.trim();
            if (taskText !== '') {
                // Create a new list item with the task text
                const li = document.createElement('li');
                li.innerHTML = '<span class="task-text">'+taskText+'</span>';
                li.appendChild(document.createElement('br'));
                li.appendChild(document.createElement('br'));

                // Add action buttons for this task
                const actionButtons = document.createElement('div');
                actionButtons.className = 'action-buttons';
                actionButtons.innerHTML = '<button class="delete-btn">Delete</button> <button class="complete-btn">Complete</button>';
                li.appendChild(actionButtons);

                // Append the list item to the taskList
                document.getElementById('taskList').appendChild(li);

                // Clear input field
                input.value = '';
            }
        }

        function deleteTask(taskElement) {
            if (taskElement.parentNode && taskElement.parentNode.children.length > 0) {
                taskElement.parentNode.removeChild(taskElement);
            }
        }

        function completeTask(taskElement) {
            const text = taskElement.querySelector('.task-text').textContent;
            // Mark the task as completed by changing its class or adding a class for completed
            if (taskElement.classList.contains('completed')) {
                taskElement.classList.remove('completed');
            } else {
                taskElement.classList.add('completed');
            }
        }
    </script>
</body>
